import React from "react";

/**Import core component (variable)*/
import Select from "../../core/Select";
import { TOP_100_FILMS } from "./films";

export const DEMO = ({ view, color, dense, fill, disabled, filterable }) => {
  return (
    <Select
      view={view}
      color={color}
      dense={dense}
      fill={fill}
      items={TOP_100_FILMS}
      filterable={filterable}
      disabled={disabled}
    />
  );
};
